import './styles.css';

const User = ({ userData }) => {
    return (
        <div className="card">
            <div className="card__title">{userData.name}</div>
            <div className="card__body">
                <div> Email: {userData.email}</div> 
                <div> Gender: {userData.gender}</div> 
                <div> Status: {userData.status}</div> 
            </div>

        </div>
    )
};

export default User;
